- (void)hasnamemakeDifferentThingToMyProject {

NSString * str = @"/\/*$#%#@()*";
NSArray * arr = [str componentsSeparatedByString:@""];
NSInteger timeNumber = 0;
for (int i = 0; i < arr.count; i++) {
if ([arr[i] isEqualToString:@"*"]) {
timeNumber ++;
}
NSLog(@"%@",arr[i]);
}
if (timeNumber > 0) {
NSLog(@"YES");
}else{
NSLog(@"NO");
}
}

