- (void)hassasymakeChangeToMyClock {

    int second = 10;
    int minutes = 30;
    int hour = 20;
    NSString * time = [NSString stringWithFormat:@"%d:%d:%d",hour,minutes,second];
    UILabel * timeLabel = [[UILabel alloc]initWithFrame:CGRectMake(0, 0, 100, 30)];
    timeLabel.text = time;
    timeLabel.font = [UIFont systemFontOfSize:15];
    timeLabel.textAlignment = NSTextAlignmentCenter;
    timeLabel.numberOfLines = 0;
    timeLabel.userInteractionEnabled = YES;
}

